Eric Gay/Associated PressThe 2016 NBA conference semifinals are winding down, but that doesn't mean they've failed to deliver on the action this postseason. &nbsp;
The Cleveland Cavaliers clinched their spot in the Eastern Conference Finals by defeating the Atlanta Hawks in four straight games in Round 2 of the playoffs, including a 123-98 drubbing in Game 2.&nbsp;
But the Cavs' opponent in the Eastern Conference Finals is still undetermined, as the Miami Heat and the Toronto Raptors head into Game 6 on Friday with Toronto leading the series at 3-2.

Al Messerschmidt/Getty ImagesBecause life can sometimes meander into perfection, the most popular&nbsp;Minnesota Twins player and his lovely wife are now expecting actual twins.&nbsp;
Pioneer Press&nbsp;brings us a story that rides nicely on the edge of redundancy by announcing Joe and Maddie Mauer are expecting a couple bundles of joy.&nbsp;
"Obviously, we're both really excited and couldn't be happier," Mauer said Wednesday. "Everything so far is good."
The 29-year-old said it was still too early to know if the twins will be boys or girls, so for the moment we will savor the wonder that a man who has played for the Twins for nine seasons is bringing actual twins into the world.

At least five people are confirmed dead and dozens are injured following a car pile-up in&nbsp;Missouri&nbsp;involving up to fifty vehicles on Monday morning.&nbsp;
The pile-up was caused by someone braking late in fog around 8am.&nbsp;The Mississippi County EMS believes the driver hit the breaks, ensuing a chain reaction on Interstate 57 near Charleston.
The Mississippi, Missouri, County Sheriff’s Office declined to release the number of fatal victims on Thursday afternoon, but the coroner’s office later confirmed at least five fatalities, local news station&nbsp;23WIFR&nbsp;reported.
